import React from 'react';
import Layout from '../../components/Layout';
import { contentContainer } from './work.module.scss';

const Work = () => {
  return (
    <Layout>
      <div className={contentContainer}>
        <h1>Work.</h1>
      </div>
    </Layout>
  );
};

export default Work;
